import React from 'react';
import './App.css';
import Login from './components/Login'
import Register from './components/Register'


function App() {
  return (
    <>
      <button>Login</button>
      <button>Register</button>
      <Route path='/login' component = {Login} />
    </>
  );
}

export default App;
